import React from 'react'
import Container from '../../Container'
import './Costela.css'

import { MdAddShoppingCart } from "react-icons/md";

const Costela = () => (
    
       
        <Container>
        <h1><MdAddShoppingCart />Costela</h1>
        
        </Container>
       
    
)


export default Costela
